import './NavBar.css';

function QuoteCards(){
  return (
    <figure class="QuoteCard">
    <img
      src="https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FNelsonMuntz.png?1497567511185"
      alt="Nelson Muntz" />
    <figcaption>
      <blockquote>
        Shoplifting is a victimless crime, like punching someone in the dark.
      </blockquote>
      <cite>Nelson Muntz</cite>
    </figcaption>
  </figure>
  );

const nelsonMuntz = {
    blockquote : 'Shoplifting is a victimless crime, like punching someone in the dark.',
    alt : "Nelson Muntz",
    cite : "Nelson Muntz",
    }


}

export default QuoteCards;
